import { useState } from "react";

export default function Search(){
    const [searchText, setSearchText] = useState("");

    return(
        <div>
            <div>
                Buscador de personal
            <label>
                <input value={searchText} onChange={({target: {value}}) => setSearchText(value)} />
            </label>
            <button>Buscar</button>
            </div>
        </div>
    );
}
